import Header from "./Header.js"
import Footer from "./Footer.js"
import React, {useState} from 'react'


function App() {
	const [lang, setLang] = useState;
	setEN = ()=>{
		setLang("EN");
	}
	setRU = ()=>{
		setLang("RU");
	}
  return (
   	<>
		<Header lang={lang} setEN={this.setEN} setRU={this.setRU} />
	  	<Footer lang={lang}/>
	</>
  );
}

export default App;
